(function () {
   const adminPage = document.querySelector('.admin-body');

   if (adminPage) {
      const $navbarBurger = document.querySelector(".navbar-burger");
      const $sidebarBackdrop = document.querySelector('#sidebarBackdrop');
      const asideBar = document.querySelector('aside');

      $navbarBurger.addEventListener("click", () => {
         // Get the target from the "data-target" attribute
         const target = $navbarBurger.dataset.target;
         const $target = document.getElementById(target);

         // console.log($target);

         // Toggle the "is-active" class on both the "navbar-burger" and the "navbar-menu"
         document.querySelector('.navbar-burger #toggleSidebarMobileHamburger').classList.toggle("hidden")
         document.querySelector('.navbar-burger #toggleSidebarMobileClose').classList.toggle("hidden")
         $sidebarBackdrop.classList.toggle("hidden");
         $target.classList.toggle("hidden");
      });

      $sidebarBackdrop.addEventListener('click', function (e) {
         if (e.currentTarget) {
            this.classList.toggle("hidden");
            document.querySelector('#nav-sidebar').classList.toggle('hidden')
         }
      })

      asideBar.addEventListener('click', function (e) {
         const target = e.target.getAttribute('data-collapse-toggle')

         if (!target) return

         const $target = document.getElementById(target);
         $target.classList.toggle("hidden");
         // console.log(target);
      })

   }


})()


